import React from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import App from "../App";
import ob from "job";

const Router = () => (

    <BrowserRouter>
        <Switch>
            <Route path="/" component={App} />
            <Route path="/result" component={job} />
        </Switch>
    </BrowserRouter>
);

export default Router;
